sys_hub_input_scripts.script:
{"discoverpayload":{"scriptActive":true,"script":"/*
**Access Flow/Action data using the fd_data object. Script must return a value. 
**Order number is offset by +1 in Error Handling Section.
**Available options display upon pressing "." after fd_data
**example: var shortDesc = fd_data.trigger.current.short_description;
**return shortDesc;
*/
var toolUrl = fd_data.subflow_inputs.current.tool_url ;
var pipelinePrefix = "Pipeline";
result = {};
result.pipelines = [];

for( var i =1 ; i< 4 ; i++){

 var pipeline = {};
 pipeline.name = pipelinePrefix + "_" + i;
 pipeline.url = toolUrl + "/" + pipeline.name ;
 pipeline.projectName = pipeline.name ; 
 pipeline.id = pipeline.name ; 
 result.pipelines.push(pipeline);
}



return JSON.stringify(result)"}}

